import React from 'react'
import { Dispatch, SetStateAction } from "react";
import TattooCard from '../../TattooCard/TattooCard'
import { userImageObject } from '../../../features/images/imagesSlice'
import { deleteImageById } from '../../../features/images/imagesAction'
import { AppDispatch } from "../../../app/store";
import { useDispatch, useSelector } from "react-redux"

interface IProps {
    image: userImageObject;
    userImagesByUserName: Array<userImageObject>;
    setUserImagesByUserName?: any
  }

const UserTattooCard = (image: userImageObject ,userImagesByUserName: any,setUserImagesByUserName: Dispatch<SetStateAction<any>>) => {
    const dispatch = useDispatch<AppDispatch>();
    const userImagesArray = useSelector((state: any) => state.images.userImages)

    function handleDelete(ev: any) {
        dispatch(deleteImageById(image._id))
        const arr = userImagesArray.filter((entry:any)=> entry._id !== image._id)
    }



    return (
        <div>
            <TattooCard {...image} />
            <button onClick={handleDelete}>Delete</button>
        </div>
    )
}

export default UserTattooCard
